import React from "react";

function Button(props) {
  const { btnType } = props;

  return (
    <>
      <button
        className={`btn-${btnType}`}
        onClick={(event) => {
          event.preventDefault();
          props.onClick();
        }}
      ></button>
    </>
  );
}

export default Button;
